INSERT INTO `new` VALUES (1,'Thông báo mất điện kí túc xá.','Kính gửi các sinh viên nội trú,\r\nBan quản lý kí túc xá thông báo về việc mất điện tạm thời tại tất cả các tòa nhà kí túc xá để thực hiện bảo trì hệ thống điện.\r\nThời gian mất điện: Từ 22:00 ngày 24/07/2024 đến 06:00 ngày 25/07/2024\r\nĐể chuẩn bị cho việc mất điện, sinh viên vui lòng thực hiện các việc sau trước 21:00 ngày 24/07/2024:\r\n\r\nSạc đầy điện thoại, laptop và các thiết bị điện tử cần thiết\r\nChuẩn bị đèn pin hoặc đèn sạc dự phòng\r\nTắt và rút phích cắm các thiết bị điện không cần thiết\r\nĐảm bảo hoàn thành công việc học tập cần dùng điện trước thời điểm mất điện\r\n\r\nSinh viên có thể tham khảo hướng dẫn chi tiết về cách chuẩn bị cho việc mất điện tại văn phòng kí túc xá.\r\nViệc tuân thủ hướng dẫn này sẽ giúp giảm thiểu tác động của việc mất điện đến sinh hoạt và học tập của sinh viên. Đề nghị tất cả sinh viên thực hiện nghiêm túc.\r\nTrong trường hợp khẩn cấp trong thời gian mất điện, vui lòng liên hệ bảo vệ kí túc xá theo số hotline: 0123456789.\r\nTrân trọng.','http://res.cloudinary.com/djuwlqgvb/image/upload/v1721631450/lmfsvsaf3it5c8fulahe.png','2024-07-22 06:57:30','2024-07-22 06:57:30');

